//import logo from './logo.svg';
import './App.css';
import React from 'react';
import { createContext } from 'react';
import { HashRouter, Route, Routes} from "react-router-dom";
import NavBar from "./Components/navbar";
import Home from "./Components/home";
import Deposit from "./Components/createaccount";
import Withdraw from "./Components/withdraw";
import CreateAccount from "./Components/createaccount";
import AllData from "./Components/alldata";



//const Route       = ReactRouterDOM.Route;
//const Link        = ReactRouterDOM.Link;
//const HashRouter  = ReactRouterDOM.HashRouter;
export const UserContext = createContext(null);

function App() {
  return (
    <HashRouter>
      <NavBar/>
      <UserContext.Provider value={{users:[{name:'jan',email:'jan@mit.edu',password:'password',balance:1000}]}}>
        <div className="container" style={{padding: "20px"}}>

          <Route exact path="/" element={<Home />}></Route>
          <Route path="/CreateAccount/" element={<CreateAccount />}></Route>component={CreateAccount} />
          <Route path="/deposit/" element={<Deposit />}></Route>component={Deposit} />
          <Route path="/withdraw/" element={<Home />}></Route>component={Withdraw} />
          <Route path="/alldata/" element={<Home />}></Route>component={AllData} />

        </div>
      </UserContext.Provider>      
    </HashRouter>
  );
}

export default App;
